function Schedule() {
    return (
        <div className="schedule">
            <div className="create_div">
                <div className="tag">CRETAE A TASK</div>
                <button type="button">
                    <img src="/images/add.png" alt="Add" />
                </button>
            </div>
            <div className="list_div border">
            </div>
        </div>
    );
}

export default Schedule;
